import React from 'react'
import Navbar from '../Navbar/Navbar'
import RegisterModal from '../RegisterModal/RegisterModal'

export default function Layout({ children }) {
    return (
        <React.Fragment>
            <div className='container-fulid mx-autohv-100'>
                <Navbar />
                <RegisterModal />
                {children}
            </div>
        </React.Fragment>
    )
}
